const Error = (props) => {
    return(
        <>
            <div className="Home py-5">
                <div className="container">
                    <div className="text-center">
                        <h1 className="text-white">Page Not Fount</h1>
                        <p className="text-center">Sorry, this page is not found</p>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Error;
